class TreeNode:
    def __init__(self, value):
        self.value = value
        self.left = None
        self.right = None

    def __repr__(self):
        return f"TreeNode({self.value}, {self.left}, {self.right})"

    def add_left(self, value):
        if self.left is None:
            self.left = TreeNode(value)
        else:
            self.left.add_left(value)

